'''

Given a string s, return the number of homogenous substrings of s. Since the answer may be too large, return it modulo 109 + 7.

A string is homogenous if all the characters of the string are the same.

A substring is a contiguous sequence of characters within a string.

Input: s = "abbcccaa"
Output: 13
Explanation: The homogenous substrings are listed as below:
"a"   appears 3 times.
"aa"  appears 1 time.
"b"   appears 2 times.
"bb"  appears 1 time.
"c"   appears 3 times.
"cc"  appears 2 times.
"ccc" appears 1 time.
3 + 1 + 2 + 1 + 3 + 2 + 1 = 13.


'''
# find the first different character to the right


class Solution:
    def countHomogenous(self, s: str) -> int:
        MOD = 10 ** 9 + 7
        stack = []

        n = len(s)

        next_different_char = [n] * n

        for i, char in enumerate(s):
            while stack and s[stack[-1]] != char:
                idx = stack.pop()
                next_different_char[idx] = i
            stack.append(i)

        # print(next_different_char)

        res = 0

        for i in range(n):
            res += (next_different_char[i] - i) % MOD
        return res % MOD


so = Solution()

s = "abbcccaa"

s = "xy"

s = "zzzzz"

s = ''''''

res = so.countHomogenous(s)

print(res)
